import React, { Component } from 'react';
import './navbar.css';
import { Button } from '@material-ui/core';

class Navbar extends Component() {
  navigateTo(page) {
    window.location.href = page;
  }

  render() {
    return (
      <div id="navbar-container">
        <div id="navbar-title-container">
          NATALIE WAGNER
        </div>
        <div id="navbar-buttons-container">
          <Button onClick={() => { navigateTo('index.html'); }}>
            Home
          </Button>
          <Button onClick={() => { navigateTo('about.html'); }}>
            About
          </Button>
          <Button onClick={() => { navigateTo('projects.html'); }}>
            Projects
          </Button>
          <Button onClick={() => { navigateTo('quiz.html'); }}>
            Quiz
          </Button>
        </div>
      </div>
    );
  }
}

export default Navbar;
